import React from 'react';
import {Card,Col,Row} from 'react-bootstrap';
import '../App.css';

const PersonCard = props => {
    return (
        <Card className = "cardLayout">
            <Card.Body>
                <Row>
                    <Col xs ={4}>
                        <h5>{props.name}</h5>
                    </Col>
                    <Col>
                        <h1>{props.name}</h1>
                    </Col>
                </Row>
            </Card.Body>
        </Card>
    );
}

export default PersonCard;
